import React from 'react';
import axios from 'axios';
import './App.css';
import Board from './components/board'

class App extends React.Component {
  state = {
    data: []
  }

  componentDidMount() {
    axios.get(`http://localhost:9393/test`)
    .then(res => {
      const data = res.data;
      this.setState({data});
    })
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.data}
        </ul>
        <Board />
      </div>
    )
  }
}

export default App;
